import React from "react";
import Header from "components/Header/Header.js";

//const useStyles = makeStyles(styles);

export default function Components(props) {
  //const classes = useStyles();
  const { ...rest } = props;
  return (
    <div>
      <Header
        brand="Material Kit React"
        fixed
        color="transparent"
        changeColorOnScroll={{
          height: 400,
          color: "black"
        }}
        {...rest}
      />
    </div>
  );
}
